import React, {FC} from 'react';
import Toe, {Type} from "./Toe";

export interface GameProps {
    width?: string,
    height?: string
}

var type: Type = Type.none;

const Game: FC<GameProps> = (
    {
        width = '300px',
        height = '300px'
    }) => {
    return (
        <div
            style={{
                width,
                height,
                display: 'flex',
                flexWrap: 'wrap',
                alignItems: 'center',
                justifyContent: 'space-around'

            }}
        >
            <Toe onClick={() => {SwitchType(type);
            }} type={type}/>

        </div>
    );

};
const SwitchType = (e: Type) => {
    console.log('SwitchType working')
    if (e == Type.none) {
        e = Type.type_o;
    } else if (e == Type.type_o) {
        e = Type.type_x;
    } else {
        e = Type.type_o;
    }
}

export default Game;
